syntax = "proto3";
import "google/protobuf/timestamp.proto";
package api;

option go_package = "/genapi";

message MinstRequest {
  google.protobuf.Timestamp time = 1;
  string fileId = 2;
}

message MinstResponse {
  int32 number = 1;
}

service MinstService {
  rpc Predict(MinstRequest) returns (MinstResponse) {}
}